def findingUsersActiveMinutes(logs, k):
    uam = {}
    for log in logs:
        id = log[0]
        time = log[1] * 10000 + log[2]
        if id not in uam:
            uam[id] = set()
        uam[id].add(time)
    result = [0] / k
    for key in uam:
        count = len(uam[key])
        if count <= k:
            result[count - 1] += 1
    return result

